import React, { Component } from "react";
import { Button, TextField } from "@material-ui/core";
import { Modal } from "react-bootstrap";
import { withCookies } from "react-cookie";

class License extends Component {
  constructor(props) {
    super(props);

    this.state = {
      modelShow: true,
      issue_date_error: "",
      expiration_date_error: "",
      deleteModalShow: false,
      credentials: {
        name: "",
        issuing_org: "",
        issue_date: null,
        expiration_date: null,
        credential_id: "",
        user: this.props.cookies.get("auth-token").user.id,
      },
    };
  }

  inputChanged = (event) => {
    console.log(event.target.value);
    let cred = this.state.credentials;
    cred[event.target.name] = event.target.value;
    this.setState({ credentials: cred });
  };

  // create new liecense or cetificate for currently login user
  createLicense = (e) => {
    fetch(`${process.env.REACT_APP_API_URL}/profile/license/`, {
      method: "POST",
      headers: {
        "Content-type": "application/json",
        Authorization: `Token ${this.props.cookies.get("auth-token").token}`,
      },
      body: JSON.stringify(this.state.credentials),
    })
      .then((resp) => resp.json())
      .then((resp) => {
        console.log(resp);
        this.props.cookies.set("license-id", resp.id);
        this.props.updateLicense();
      })
      .catch((error) => console.log(error));

    e.preventDefault();
    this.props.onLicenseModal(false);
  };

  // edit license or certificate for currently login user
  editLicense = (e) => {
    fetch(
      `${process.env.REACT_APP_API_URL}/profile/license/${this.props.editLicense_id}/`,
      {
        method: "PUT",
        headers: {
          "Content-type": "application/json",
          Authorization: `Token ${this.props.cookies.get("auth-token").token}`,
        },
        body: JSON.stringify(this.state.credentials),
      }
    )
      .then((resp) => resp.json())
      .then((resp) => {
        console.log(resp);
        if (!resp.name) {
          if (resp.issue_date) {
            this.setState({ issue_date_error: resp.issue_date });
          }
          if (resp.expiration_date) {
            this.setState({ expiration_date_error: resp.expiration_date });
          }
        } else {
          this.setState({ modelShow: false });
          this.props.updateLicense();
          e.preventDefault();
          this.props.onLicenseModal(false);
        }
      })
      .catch((error) => console.log(error));
  };

  // get data for particular license
  getLicenseData = () => {
    if (
      this.props.cookies.get("deleted-license-id") !== this.props.editLicense_id
    ) {
      fetch(
        `${process.env.REACT_APP_API_URL}/profile/license/${this.props.editLicense_id}/`,
        {
          method: "GET",
          headers: {
            "Content-type": "application/json",
            Authorization: `Token ${
              this.props.cookies.get("auth-token").token
            }`,
          },
        }
      )
        .then((resp) => resp.json())
        .then((resp) => {
          // console.log(resp);
          if (resp) {
            this.setState({
              credentials: {
                name: resp.name,
                issuing_org: resp.issuing_org,
                issue_date: resp.issue_date,
                expiration_date: resp.expiration_date,
                credential_id: resp.credential_id,
                user: this.props.cookies.get("auth-token").user.id,
              },
            });
          }
        })
        .catch((error) => console.log(error));
    }
  };

  // delete license
  deleteLicense = (e) => {
    this.props.cookies.set("deleted-license-id", this.props.editLicense_id);
    fetch(
      `${process.env.REACT_APP_API_URL}/profile/license/${this.props.editLicense_id}/`,
      {
        method: "DELETE",
        headers: {
          "Content-type": "application/json",
          Authorization: `Token ${this.props.cookies.get("auth-token").token}`,
        },
      }
    )
      .then((resp) => this.props.updateLicense())

      .catch((error) => console.log(error));
  };

  deleteModalDisplay = () => {
    console.log("hell");
    this.setState({ deleteModalDisplay: true });
  };

  componentDidMount() {
    if (!this.props.onCreateLicense) {
      this.getLicenseData();
    }
  }

  render() {
    return (
      <div>

        {true ? (
          <Modal show={this.state.deleteModalShow}>
            <Modal.Body>
              <h5>Are you sure ?</h5>
              <Modal.Footer>
                <Button>yes</Button>
              </Modal.Footer>
            </Modal.Body>
          </Modal>
        ) : null}
      </div>
    );
  }
}

const save_button = {
  paddingLeft: "20px",
  paddingRight: "20px",
  marginTop: "10px",
  marginLeft: "10px",
  fontWeight: "bold",
  borderRadius: "50px",
  display: "flex",
  background: "#0c66c2",
  color: "white",
  border: "solid 1px #0c66c2",
};

export default withCookies(License);
